DROP TABLE IF EXISTS movimiento_nivel;
DROP TABLE IF EXISTS blanco_movimiento;
DROP TABLE IF EXISTS clase_movimiento;
DROP TABLE IF EXISTS pokemon;
DROP TABLE IF EXISTS tipo_elemental;
CREATE TABLE tipo_elemental(
	id_tipo INT AUTO_INCREMENT,
    nombre_tipo VARCHAR(100),
    valor_rojo INT,
    valor_verde INT,
    valor_azul INT,
    foto_tipo LONGBLOB,
    activo TINYINT,
    PRIMARY KEY(id_tipo)
)ENGINE=InnoDB;
CREATE TABLE pokemon(
	id_pokemon INT AUTO_INCREMENT,
    fid_tipo_1 INT,
    fid_tipo_2 INT,
    numero_pokedex_nacional VARCHAR(3),
    nombre VARCHAR(100),
    generacion ENUM('PRIMERA_GENERACION', 'SEGUNDA_GENERACION','TERCERA_GENERACION'),
    peso DECIMAL(10,2),
    altura DECIMAL(10,2),
    descripcion VARCHAR(3000),
    foto LONGBLOB,
    activo TINYINT,
    PRIMARY KEY(id_pokemon),
    FOREIGN KEY(fid_tipo_1) REFERENCES tipo_elemental(id_tipo),
    FOREIGN KEY(fid_tipo_2) REFERENCES tipo_elemental(id_tipo)
)ENGINE=InnoDB;
CREATE TABLE clase_movimiento(
	id_clase_movimiento INT AUTO_INCREMENT,
    clase_movimiento VARCHAR(100),
    foto_clase_movimiento LONGBLOB,
    activo TINYINT,
    PRIMARY KEY(id_clase_movimiento)
)ENGINE=InnoDB;
CREATE TABLE blanco_movimiento(
	id_blanco_movimiento INT AUTO_INCREMENT,
    blanco_movimiento VARCHAR(100),
    descripcion_blanco_movimiento VARCHAR(3000),
    activo TINYINT,
    PRIMARY KEY(id_blanco_movimiento)
)ENGINE=InnoDB;
CREATE TABLE movimiento_nivel(
	id_movimiento_nivel INT AUTO_INCREMENT,
	fid_pokemon INT,
    fid_tipo INT,
    fid_clase INT,
    fid_blanco INT,
    nivel_aprendizaje INT,
    nombre_movimiento VARCHAR(100),
    poder INT,
    exactitud INT,
    puntos_poder INT,
    activo TINYINT,
    PRIMARY KEY(id_movimiento_nivel),
    FOREIGN KEY(fid_pokemon) REFERENCES pokemon(id_pokemon),
    FOREIGN KEY(fid_clase) REFERENCES clase_movimiento(id_clase_movimiento),
    FOREIGN KEY(fid_blanco) REFERENCES blanco_movimiento(id_blanco_movimiento),
    FOREIGN KEY(fid_tipo) REFERENCES tipo_elemental(id_tipo)
)ENGINE=InnoDB;
